import React from "react";
import { Tile } from "../../components/tile/Tile";

export const TileList = ({contacts}) => {
  return (
    <>
      {contacts.map((contact, index) => (
        <div key={index}>
          <h2>{contact.name}</h2>
          <h3>{contact.phone}</h3>
          <h3>{contact.email}</h3>
        </div>
      ))
    }
  </>
  );
};
